import React, { useState } from "react";
import { Button, TextField } from "@mui/material";
import { useNavigate } from "react-router-dom";
import "./Login.css";
import axios from "axios";
import blitzLogo from "../../Components/globalAssets/blitzLogo.png";

const Register = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    username: "",
    password: "",
    reEnterPassword: "",
    streetAddress: "",
    city: "",
    state: "",
    country: "",
    company: "",
    ssnTaxId: "",
  });

  // Update formData state on user input
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // Function to send formData to backend
  const handleRegistration = async () => {
    try {
      if (formData.password !== formData.reEnterPassword) {
        alert("Passwords do not match!");
        return;
      }

      const apiUrl = process.env.REACT_APP_BACKEND_URL;
      // Adjust the URL to your backend endpoint
      const response = await axios.post(`${apiUrl}/register`, formData);
      console.log("Registration successful", response.data);
      // Redirect or further actions upon successful registration
      navigate("/dashboard");
    } catch (error) {
      if (error.response && error.response.status === 409) {
        // Specific handling for 409 Conflict
        alert("A user with the email already exists. Please try again.");
      } else {
        // Generic error handling
        alert("Registration failed. Please try again later.");
      }
      console.error("Registration failed", error);
    }
  };

  return (
    <div className="login-container">
      {/* Left column */}
      <div className="logo-container">
        <img src={blitzLogo} alt="blitzLogo" />
      </div>

      {/* Right column */}
      <div className="form-container">
        <h2>Welcome to Blitz!</h2>
        <p>Enter your information to continue with Blitz</p>

        <div className="field-row">
          <TextField
            name="firstName"
            value={formData.firstName}
            className="field"
            label="First Name"
            variant="outlined"
            onChange={handleInputChange}
            style={{ marginRight: "10px" }}
          />
          <TextField
            name="lastName"
            className="field"
            label="Last Name"
            variant="outlined"
            value={formData.lastName}
            onChange={handleInputChange}
            style={{ marginRight: "10px" }}
          />
        </div>

        <div className="field-row">
          <TextField
            name="email"
            className="field"
            label="Email"
            variant="outlined"
            value={formData.email}
            onChange={handleInputChange}
            style={{ marginRight: "10px" }}
          />
          <TextField
            name="username"
            className="field"
            label="Desired Username"
            variant="outlined"
            value={formData.username}
            onChange={handleInputChange}
            style={{ marginRight: "10px" }}
          />
        </div>

        <div className="field-row">
          <TextField
            name="password"
            type="password"
            value={formData.password}
            onChange={handleInputChange}
            className="field"
            label="Password"
            variant="outlined"
            style={{ marginRight: "10px" }}
          />
          <TextField
            name="reEnterPassword"
            value={formData.reEnterPassword}
            onChange={handleInputChange}
            className="field"
            label="Re-enter Password"
            variant="outlined"
            type="password"
            style={{ marginRight: "10px" }}
          />
        </div>

        <div className="field-row">
          <TextField
            name="streetAddress"
            value={formData.streetAddress}
            onChange={handleInputChange}
            className="field"
            label="Street Address"
            variant="outlined"
            style={{ marginRight: "10px" }}
          />
          <TextField
            name="city"
            value={formData.city}
            onChange={handleInputChange}
            className="field"
            label="City"
            variant="outlined"
            type="password"
            style={{ marginRight: "10px" }}
          />
        </div>

        <div className="field-row">
          <TextField
            name="state"
            value={formData.state}
            onChange={handleInputChange}
            className="field"
            label="State"
            variant="outlined"
            style={{ marginRight: "10px" }}
          />
          <TextField
            name="country"
            value={formData.country}
            onChange={handleInputChange}
            className="field"
            label="Country"
            variant="outlined"
            type="password"
            style={{ marginRight: "10px" }}
          />
        </div>

        <div className="field-row">
          <TextField
            name="company"
            value={formData.company}
            onChange={handleInputChange}
            className="field"
            label="Company"
            variant="outlined"
            style={{ marginRight: "10px" }}
          />
          <TextField
            name="ssnTaxId"
            value={formData.ssnTaxId}
            onChange={handleInputChange}
            className="field"
            label="SSN/Tax ID"
            variant="outlined"
            style={{ marginRight: "10px" }}
          />
        </div>

        <Button
          variant="contained"
          color="primary"
          size="large"
          onClick={handleRegistration}
          className="submit-button"
        >
          Create Account
        </Button>
      </div>
    </div>
  );
};

export default Register;
